/**
 * @param {string} s
 * @return {boolean}
 */
var isValid = function(s) {
    const stack = [];
    const mapping = {')': '(', '}': '{', ']': '['};
    for (let i = 0; i < s.length; i++) {
        if (!mapping[s[i]]) {
            stack.push(s[i]);
        } else if (stack.pop() !== mapping[s[i]]) {
            return false;
        }
    }
    return !stack.length;
};

class Solution {
    public boolean isValid(String s) {
        Stack<Character> stack = new Stack<>();
        for (char c : s.toCharArray()) {
            if (c == '(') stack.push(')');
            else if (c == '{') stack.push('}');
            else if (c == '[') stack.push(']');
            else if (stack.isEmpty() || stack.pop() != c) return false;
        }
        return stack.isEmpty();
    }
}

class Solution {

    /**
     * @param Integer $x
     * @return Boolean
     */
    function isPalindrome($x) {
        $x = (string) $x;
        $left = 0;
        $right = strlen($x) - 1;

        while ($left < $right) {
            if ($x[$left] !== $x[$right]) {
                return false;
            }
            $left++;
            $right--;
        }
        return true;
    }
}

